import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component{
  constructor(){
    super();

    this.state = {
       arts:[
        {
          name:'Abstract',
          id:1
        },
        {
          name:'Patterns',
          id:2
        },
        {
          name:'digitalArt',
          id:3
        }

      ]
    };
  }

  render(){
    return (
      <div className="App">




        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            {this.state.string}
            Learn React1s3
          </a>
          <button onClick={() => this.setState({string:'hello Neha'})}>button</button>
        </header>
      </div>
    );
  }
}
